import React from 'react'

function Navbar({ title = "Home", title2 = "Menue" }) {
  return (
    <div className="nav">
      <div className="item" style={{marginLeft:"50px"}}>{title}</div>
      <div className="item">{title2}</div>
      <div className="item">AboutUs</div>
      <div className="item">View</div>
    </div>
  );
}



export default Navbar
